import { Box, Typography, List, ListSubheader, ListItem } from "@mui/material";
import React from "react";

const NoGroupsFound = () => {
    return (
        <Box
            sx={{
                p: "40px",
                m: "10px",
                borderRadius: "40px",
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
            }}>
            <Box sx={{
                display: "flex",
                mb: 2,
                flexDirection: "column",
                justifyContent: "center",
                alignItems: "center",
            }}>
                <Typography>
                    Your search did not match any groups.
                </Typography>
                <List sx={{ listStyleType: 'disc' }}>
                    <ListSubheader>
                        Suggestions
                    </ListSubheader>
                    <ListItem>Double check your spelling</ListItem>
                    <ListItem>Your search may have been removed or is not yet in the system</ListItem>
                </List>
                <Typography>
                    If you believe this is an error, please reach out to someone on your group's leadership or <a href="mailto:han@joininbound.com">han@joininbound.com</a> for assistance.
                </Typography>
            </Box>
        </Box>
    );
};

export default NoGroupsFound;
